//Fragment Informacion mision y vision. mission view Accompany the Awá community in the process of consolidating their own educational system based on their language, autonomy, principles, care for the environment and customs in such a way as to allow them to strengthen their culture. Locate its members in the productive sector, community leadership and consequently achieve its collective and historical singular realization. The Educational Institution Agroambiental Bilingual Awá, is built as an enabling environment for human and community development and conceives its reason for being in processes that affirm autonomy, freedom, democracy, and defense of its territory as heritage and legacy of their ancestors The Awá Bilingual Technical Agricultural Educational Institution, will tend to be the center and corporate image of the Awá community, recognized at the local, regional and national level as an educational - cultural space of integral formation of its members; motivating them to continue higher studies, which contribute to the improvement and quality of life of the indigenous people of the community. It counts for it with committed personnel that guarantees the achievement of this purpose.
